import React from 'react';
import {BrowserRouter as Router, Routes,Route} from 'react-router-dom';
import Login from "../login/login";

export default function AppRoutes() {
    
        return (  
            <Router>
                <Routes>
                    <Route exact path="/login" element ={<Login/>} />
                </Routes>
            </Router>
        );
    }
